package br.poli.ecomp.geav.nhe.model.db.aca;import br.poli.ecomp.geav.nhe.model.db.Table;import br.poli.ecomp.geav.nhe.model.db.cmp.IComposition;import br.poli.ecomp.geav.nhe.model.db.ptc.IParticipation;import br.poli.ecomp.geav.nhe.model.db.tpa.ITipoAcao;	public class Action extends Table implements IAction{	private int aca_identificador;	private IParticipation ptc_identificador;	private ITipoAcao tpa_identificador;	private IAction aca_pai;	private IComposition cmp_identificador;	private String aca_data_atual;		public Action()	{	}	@Override	public String get_aca_data_atual() {		return this.aca_data_atual;	}	@Override	public int get_aca_identificador() {		return this.aca_identificador;	}	@Override	public IAction get_aca_pai() {		return this.aca_pai;	}	@Override	public IComposition get_cmp_identificador() {		return this.cmp_identificador;	}	@Override	public IParticipation get_ptc_identificador() {		return this.ptc_identificador;	}	@Override	public ITipoAcao get_tpa_identificador() {		return this.tpa_identificador;	}	@Override	public void set_aca_data_atual(String value) {		this.aca_data_atual = value;	}	@Override	public void set_aca_identificador(int value) {		this.aca_identificador = value;	}	@Override	public void set_aca_pai(IAction value) {		this.aca_pai = value;	}	@Override	public void set_cmp_identificador(IComposition value) {		this.cmp_identificador = value;	}	@Override	public void set_ptc_identificador(IParticipation value) {		this.ptc_identificador = value;	}	@Override	public void set_tpa_identificador(ITipoAcao value) {		this.tpa_identificador = value;	}	}
